INSERT INTO `editeurs` VALUES (1,'LU','FR','LU, anciennement Lefèvre-Utile, est une marque française de biscuits emblématique de la ville de Nantes.\r\nL\'entreprise Lefèvre-Utile a été créée en 1846 par Jean-Romain Lefèvre.','LU.PNG',1846,NULL,'LU, anciennement Lefèvre-Utile, est une marque française de biscuits emblématique de la ville de Nantes créée en 1846.'),(2,'SCHLEICH','DE','Schleich a été fondée en 1935 par Friedrich Schleich.\r\nLes premières figurines ont été commercialisées en 1950 avec le développement, la production et le marketing de figurines sous licences encore très populaires aujourd\'hui (Schtroumpfs, Snoopy, le Muppet Show, etc.).','SCHLEICH.PNG',1935,NULL,''),(3,'BULLYLAND','DE','Société Allemande fondée en 1973. Connue dans le monde entier comme fabricant de figurines de collectionneurs peintes à la main.','BULLYLAND.PNG',1973,NULL,'Société Allemande fondée en 1973 et basée à Spraitbach.\r\nConnue dans le monde entier comme fabricant de modèles et de figurines de collectionneurs peints à la main.\r\nBullyland possède des bureaux à New York et à Hong Kong, ses propres installations de production en Allemagne et en Europe de l\'Est et un réseau de distribution mondial.'),(4,'INCONNU','-','Les objets ci-dessous n\'ont pas encore d\'éditeurs d\'identifiés.','INCONNU.PNG',NULL,NULL,''),(5,'LE LOMBARD','BE','Le Lombard est une maison d\'édition belge de bandes dessinées, fondée en 1946 par Raymond Leblanc en vue d\'assurer la diffusion et la vente en kiosques du journal Tintin.\r\n','LOMBARD.PNG',1946,NULL,'Le Lombard (les Éditions du Lombard jusqu\'en 1989) est une maison d\'édition belge de bandes dessinées, fondée en 1946 par Raymond Leblanc en vue d\'assurer la diffusion et la vente en kiosques du journal Tintin, un hebdomadaire pour la jeunesse créé parallèlement. \r\nDepuis 1986, Le Lombard fait partie du groupe Média Participations, au même titre actuellement que les éditions Dargaud et Dupuis, chacune de ces maisons gardant sa totale indépendance éditoriale.'),(6,'EDITIONS ATLAS','FR','Éditions Atlas créée en 1975 est une société française de vente par correspondance fermée en 2019.','ATLAS.PNG',1975,2019,'Éditions Atlas créée en 1975 est une société française de vente par correspondance fermée en 2019.\r\nElle est la filiale française de The Atlas Group, société suisse implantée à Lausanne, appartenant à la holding De Agostini, une multinationale basée en Italie, premier éditeur mondial de fascicules et de technologies de jeux de hasard.\r\nLe siège social de la filiale française est à Évreux, dans l\'Eure.'),(7,'CARREFOUR MARKET','FR','Carrefour est un groupe français de la grande distribution créé en 1959 à Annecy.','CARREFOUR_MARKET.PNG',1959,NULL,'Carrefour est un groupe français du secteur de la grande distribution.\r\nCréé en 1959 à Annecy, il est présent en Europe, en Amérique du Sud et en Asie, ainsi que dans d’autres zones du monde sous forme de partenariat local.\r\nPionnier du concept d’hypermarché en 1963, il est également présent dans d’autres formats de la grande distribution : les supermarchés, les magasins de proximité et le libre-service de gros.'),(8,'CARTAMUNDI','BE','Cartamundi Group créée en 1970 est une société basée à Turnhout , en Belgique, qui fabrique, produit et vend des jeux de société, des jeux de cartes.\r\nLe nom de l\'entreprise en latin signifie cartes pour le monde .','CARTAMUNDI.PNG',1970,NULL,'Cartamundi Group créée en 1970 est une société basée à Turnhout , en Belgique, qui fabrique, produit et vend des jeux de société, des jeux de cartes, des jeux de cartes à collectionner, des emballages et des cartes à jouer à travers ses filiales de fabrication et de vente. \r\nLe nom de l\'entreprise en latin signifie cartes pour le monde . C\'est l\'un des plus grands fabricants de cartes à jouer au monde.'),(9,'CITEL','FR','Citel a été fondée en 1986. Un accord de licence vidéo des droits des Aventures de Tintin est signé en 1992.','CITEL.PNG',1986,NULL,'Citel a été fondée en 1986, La société a d\'abord édité sous le label Citel Vidéo des documentaires.\r\nCitel se développe en 1992 avec un accord de licence vidéo des droits des Aventures de Tintin créé un an plus tôt pour la télévision. Puis des séries et longs métrages d\'animation, principalement d\'origine européenne.'),(10,'LIVRARIA BERTRAND','PL','Livraria Bertrand est la plus ancienne librairie en activité au monde.\r\nFondée en 1732 à Lisbonne , au Portugal .','BERTRAND.PNG',1732,NULL,''),(11,'DELACOSTE','FR','La société Delacoste, héritière de la société Derolland qui fabrique des jouets en caoutchouc depuis 1862.\r\nElle a été racheté par la société VULLIERME en 1982 qui devient VULLI en 1989.','DELACOSTE.PNG',1860,1982,''),(12,'ESSO','US','La Eastern States Standard Oil (ESSO) est créé en 1911. En 1972, cette marque a été remplacée aux États-Unis par Exxon, tandis que Esso est resté largement utilisée ailleurs dans le monde.','ESSO.PNG',1911,NULL,'La Eastern States Standard Oil (ESSO) est créé en 1911.\r\nEn 1972, cette marque a été en grande partie remplacée aux États-Unis par la marque Exxon après avoir acheté la Humble Oil, tandis que Esso est resté largement utilisée ailleurs dans le monde.'),(13,'FIL A FILM','FR','Editeur de cassettes vidéos créé en 1982.\r\nCette société deposera le bilan en 2002.','FIL_A_FILM.PNG',1982,2002,''),(14,'FILM OFFICE','FR','Editeur de cassettes vidéos créé en 1980.\r\nCette société deposera le bilan en 2001 et cédera ses droits à M6 Vidéo.','FILM_OFFICE.PNG',1980,2001,''),(15,'LA POSTE','FR','La Poste est une société anonyme française principalement présente en tant qu\'opérateur de services postaux, banque, assurance, opérateur de téléphonie mobile.','LA_POSTE.PNG',NULL,NULL,''),(16,'LANCO','ES','LANCO TOYS est une société familiale espagnole fondée en 1952.','LANCO.PNG',1952,NULL,'http://www.asatoys.fr/marque/lanco-toys'),(17,'MC DONALDS','US','McDonald\'s est une chaine de restauration rapide américaine présente dans le monde entier, fondée par l\'homme d\'affaires Ray Kroc,\r\nen 1952 après qu\'il eut acheté les droits à une petite chaîne de hamburger exploitée à partir de 1940 par Richard et Maurice McDonald.','MCDO.PNG',1952,NULL,''),(18,'MIRIM TOYS','FR','Société belge fabriquant de jouet','MIRIM.PNG',NULL,NULL,''),(19,'MOULINSART','BE','MOULINSART est une société anonyme (s.a.) de droit belge chargée de l’exploitation commerciale de l’oeuvre d’Hergé notamment à travers ses éditions et ses produits dérivés depuis 1986.','MOULINSART.PNG',1986,0,'MOULINSART est une société anonyme (s.a.) de droit belge chargée de l’exploitation commerciale de l’oeuvre d’Hergé notamment à travers ses éditions et ses produits dérivés depuis 1986.\r\nElle est créée en 1986 exerce ses activités dans différentes secteurs: le textile, les objets (statuettes, figurines, jouets, vaisselle, etc), l’édition (les Editions MOULINSART), la papeterie et le multimédia (internet, applications, production audiovisuelle).'),(20,'NOEL MONTBRISON','-','','NOEL MONTBRISON.PNG',0,0,'Pas de logo Chercher : logo jeux noel montbrison pour des logos dans les photos'),(21,'PARPICS','-','','PARPICS.PNG',NULL,NULL,'Pas de logo '),(22,'PINATERIA INTECO','CO','Société colombienne, fabriquant des jouets en plastique',NULL,NULL,NULL,'Pas de logo '),(23,'PLASTOY','FR','Fondé en 1983 par Philippe-Antoine Guénard en Normandie.\r\nCette société comprend aussi PIXI et COLLECTOY.','PLASTOY.PNG',1983,NULL,''),(24,'SICA-TOYS','BE','Société belge fabriquant de jouet','SICA-TOYS.PNG',0,0,''),(25,'STENVAL','BE','Société laitières fondée en 1911 et située à Steenvoorde (Nord).\r\nSuite à son développement, la société est reprise par GERVAIS-DANAONE.','STENVAL.PNG',1967,NULL,'Au milieu des années 1960, la société Fermiers Réunis des Flandres, fondée en 1911 et située à Steenvoorde (Nord), prend le nom de STENVAL.\r\nSuite à son développement, la société est reprise par GERVAIS-DANAONE, groupe alimentaire qui fusionnera avec BSN en 1973.\r\nLa marque STENVAL disparaitra, ces produits étant dorénavant distribués sous le nom de DANONE. Les yaourts, les petits-suisses... eurent beaucoup de succès auprès des jeunes (et des moins jeunes...). Mais mon souvenir restera le dessert chocolaté BOOM qui était un lait géléifié au chocolat. A cette époque, ce dessert était tout nouveau et changeait par rapport aux autres produits laitiers, même si l\'arrivée des fruits dans les yaourts avait déjà été un bouleversement.'),(26,'TYCO','-','Fondée en 1970, Tyco sera racheté par Mattel en 1997','TYCO.PNG',1970,1997,''),(27,'VICMA','ES','Société portugaise','VICMA.PNG',NULL,NULL,''),(28,'WARNER BROS','US','Fondée en 1923, Warner Bros. Pictures est l\'une des plus grandes sociétés de production et de distribution au monde, pour le cinéma et la télévision.','WARNER.PNG',1923,NULL,''),(29,'JIM','FR','JIM ou Jouets Modernes Incassables est une société fondée en 1947. Cette entreprise familiale installée à Paris grandit rapidement grâce à l\'esprit commercial et innovateur de son fondateur.','JIM.PNG',1947,NULL,'http://www.chevalierdelenfance.com/chevaliers/chevaliers-en-plastique/14-chevaliers/chevaliers-en-plastique/254-jim\r\nJIM ou Jouets Modernes Incassables est une société fondée par Monsieur Roudié en 1947. Cette entreprise familiale installée à Paris grandit rapidement grâce à l\'esprit commercial et innovateur de son fondateur. Le logo de la marque est un losange contenant les lettres majuscules JIM sur lesquelles est superposé un spahi sur un cheval cabré, l\'une des premières pièces de qualité produite par la firme. La preuve de la vivacité des initiatives de Monsieur Roudié est qu\'il est le premier, en 1957, à avoir décroché un contrat avec \"Walt Disney Mickey House SA\" afin de produire et commercialiser en France des figurines issues des films et dessins animés Disney. Cette idée est communément appelée aujourd\'hui merchandising. Le Moyen-âge comporte 3 séries. La première fut lancée en 1962/63, la deuxième, en 1964. Les figurines de la deuxième série sont plus fines par rapport à celles bien en chair de la première, ce qui laisse supposer que deux sculpteurs différents les ont créées. Dans leur style différent, elles sont de belle facture avec des socles épais et solides. Les poses sont combattives. La peinture est standartisée notamment le socle en jaune sable, cependant il existe un schéma de peinture avec socle brun fonçé comme pour les fantassins romains et des couleurs différentes que celles qui décorent habituellement les chevaliers. Pour l\'anecdote, le sculpteur s\'est inspiré pour le cavalier avec pennon d\'un ouvrage sur les armures médiévales, édité au XIXième siècle. Pour la troisième série, Monsieur Roudié prolongea son idée d\'exclusivité et obtint les droits de production pour des figurines représentant les héros du feuilleton télévisé diffusé par l\' ORTF, en 1968/69 : \"Thibaud ou les Croisades\". Les aventures de Thibaud, fils d\'une princesse arabe et d\'un baron chrétien, accompagné de son fidèle compagnon, Blanchot, ont eu un succès retentissant auprès des gamins en culotte courte de l\'époque. La musique du générique composée par George Delerue est envoutante et donne vraiment envie de foncer au galop, cape et étendard au vent, sur les plaines désertiques. Les personnages sont à nouveau sculptés de manière inégale. Les épées sont particulièrement larges mais c\'est également le cas dans le feuilleton. Il y a peut-être une volonté de similitude. Sur le socle est gravé le nom du héros ou plus simplement \"les croisades\" pour les templiers et les sarrasins. Les guerriers sarrasins sont déclinés en plusieurs couleurs variées. Il existe une petite variante pour l\'unique cavalier sarrasin tirant à l\'arc avec ou sans flèche. Un seul cheval a été utilisé pour tous les cavaliers des 3 séries, revêtu soit d\'une robe blanche soit brun clair. (Ref: THOMAS, Alain, Historique des marques françaises, Tome I, Cyrnos et JIM, www.impribeau.be, 2013).'),(30,'CASTERMAN','BE','Casterman est une maison d\'édition de bande dessinée et de livres pour la jeunesse créée en 1777 à Tournai par Donat Casterman.','CASTERMAN.PNG',1977,0,''),(31,'KIDS CARTOON','FR','','KIDS CARTOON.PNG',0,0,''),(32,'EX.IN.CO','FR','EX.IN.CO était situé au 40avenue de la république PARIS XI\r\nTel : ROQ 7256\r\nUsines et services expedition : Maillard EXINCO\r\nNeufChatel en bray','EX.IN.CO.PNG',0,0,''),(33,'UNITED LABELS','DE','Société Allemande,créée en 1991, spécialiste de la vente de personnage de BD sous licence','UNITED LABELS.PNG',1991,0,''),(34,'SERI','FR','Seri France 57 Thionville','SERI.PNG',0,0,''),(35,'QUAKER OATS','US','Quaker Oats est née en 1901 de la fusion de quatre entreprises céréalières américaines. La société s’est ensuite développée dans de nombreux domaines, y compris les jouets, avec l’acquisition de Fisher-Price en 1969, revendue de 1991 à 1993 à Mattel.\r\n\r\nQuaker Oats a été achetée par Pepsico en 2001. Celui-ci convoitait alors la marque Gatorade, détenue par Quaker.','QUAKER OATS.PNG',1901,0,''),(36,'OLA','FR','Nom de la marque MIKO au Portugal','OLA.PNG',1920,0,''),(37,'YOSHINORI RINS','-','','',0,0,''),(38,'CONFISERIE BROCHET','-','','',0,0,''),(39,'CESAR','FR','Créée en 1842, la société familiale française CESAR a su devenir un acteur majeur sur le marché européen des produits festifs. A l’origine spécialisée dans la création de masques, l’entreprise a développé un grand savoir-faire dans la création de déguisements.','CESAR.PNG',0,0,''),(40,'JOKER PUBLICIDAD','ES','JOKER PUBLICIDAD est un promoteur publictaire espagnol',NULL,0,0,''),(41,'GUND','US','Gund est un fabricant d\'animaux en peluche. La société est basée à Edison dans le New Jersey et distribue à travers les États-Unis, le Canada ainsi qu\'en Europe, au Japon, en Australie et en Amérique du Sud.','GUND.PNG',1898,0,''),(42,'FRUIT D OR','FR','Marque de Margarine de la multinationale néerlando-britannique Unilever','FRUIT D OR.PNG',0,0,''),(43,'ROMBALDI','FR','Racheté par la Redoute puis Hachette.','ROMBALDI.PNG',0,0,''),(44,'BP GRIMAUD','FR','Editeur imprimeur de jeu de cartes','',0,0,''),(45,'CHEQUES TINTIN','BE','','CHEQUES TINTIN.PNG',0,0,''),(46,'WILLEB','FR','','WILLEB.PNG',0,0,''),(47,'RAVENSBURGER','DE','Ravensburger est une entreprise allemande spécialisée dans la fabrication et la distribution de jeux, jouets, livres et puzzles, créée en 1883 à Ravensburg.','RAVENSBURGER.PNG',1883,0,''),(48,'JEUX NATHAN','FR','Jeux Nathan était un éditeur de jeux de société basé en France, appartenant à la maison d\'édition Nathan.','JEUX NATHAN.PNG',0,0,''),(49,'DUJARDIN','FR','','DUJARDIN.PNG',0,0,''),(50,'CHAUSSURES TINTIN','BE','','CHAUSSURES TINTIN.PNG',0,0,''),(51,'HACHETTE','FR','','HACHETTE.PNG',0,0,''),(52,'HAPAX','-','','',0,0,''),(53,'VILAC','FR','Situé en France en plein cœur du Jura, depuis 1911, Vilac est le spécialiste français des jeux et jouets en bois pour enfant.','VILAC.PNG',1911,0,''),(54,'STAR COMICS','ES','Société espagnole','STAR COMICS.PNG',0,0,''),(55,'BPOST','BE','La poste Belge','BPOST.PNG',0,0,''),(56,'SILAN','-','Fabriquant de Lessive','SILAN.PNG',0,0,''),(57,'MAKO CREATIONS','FR','','MAKO CREATIONS.PNG',0,0,''),(58,'TACTIC','FR','Distributeur de jeux de sociétés','TACTIC.PNG',0,0,''),(59,'CORNER','FR','','CORNER.PNG',0,0,''),(60,'WETA WORKSHOP','NZ','Weta Workshop est une entreprise spécialisée dans les effets spéciaux pour le cinéma et la télévision.','WETA WORKSHOP.PNG',1987,0,''),(61,'DARGAUD','FR','Dargaud est une maison d\'édition française spécialisée dans la bande dessinée, fondée par Georges Dargaud en 1936 et immatriculée en 1943.','DARGAUD.PNG',1936,0,''),(62,'OLIBET','FR','Biscuiterie Bordelaise','OLIBET.PNG',1840,0,''),(63,'MECCANO','GB','Meccano Ltd. est né à Liverpool en 1901 fabriquant le jeu Meccano, les trains Hornby, les Dinky Toys. La filiale française Meccano SA fut créée en 1912 à Paris et devint la maison mère, dont le siège et la principale usine sont situés à Calais.','MECCANO.PNG',1902,0,''),(64,'LA POSTE CONGO','CD','','LA POSTE CONGO.PNG',0,0,''),(65,'LIPTON','GB','Lipton est une marque alimentaire britannique spécialisée dans les soupes, le thé et les boissons à base de thé. Créée dans les années 1870 par Thomas Lipton, elle fait maintenant partie du groupe anglo-néerlandais Unilever.','LIPTON.PNG',1870,0,''),(66,'ANDROS','FR','Andros est une entreprise de l\'industrie agroalimentaire et une marque française spécialisée dans la transformation de fruits et de laitages.','ANDROS.PNG',1946,0,''),(67,'NINTENDO','JP','Créée le 23 septembre 1889, ce n\'est qu\'au début des années 1970 va vers le marché des jeux videos.','NINTENDO.PNG',1889,0,''),(68,'SEGA','JP','Sega etait un fabricant de consoles de jeux vidéo, mais à la suite de l\'échec commercial de la console de Saturn en 2001, Sega se consacre uniquement au développement de jeux.','SEGA.PNG',1940,0,''),(69,'INFOGRAMES','FR','Infogrames Entertainment SA (ou Infogrames, ou IESA) était une société française de développement, d\'édition et de distribution de jeux vidéo, fondée en 1983 par Bruno Bonnell et Christophe Sapet. Infogrames Entertainment SA est devenue Atari SA en 2009.(Wikipedia)','INFOGRAMES.PNG',1983,2003,''),(70,'UBISOFT','FR','Entreprise française de développement, d\'édition et de distribution de jeux vidéo, créée par les cinq frères Guillemot, originaires de Carentoir dans le Morbihan, en France.','UBISOFT.PNG',1986,0,''),(71,'ROZENCO','BE','Fabriquant de fournitures de bureau Belge','',0,0,''),(72,'DUBREUCQ','BE','Dubreuc est une entreprise belge spécialisée dans le cartonnage','',0,0,''),(73,'TY','US','Fabriquant de peluches créé à Oak Brook, dans l\'Illinois.','TY.PNG',1986,0,''),(74,'ACI','-','','',0,0,'');
