DROP TABLE IF EXISTS `objets`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `objets` (
  `objid` int(11) NOT NULL AUTO_INCREMENT,
  `serid` int(11) DEFAULT NULL,
  `objnom` varchar(100) NOT NULL,
  `objtaille` double(6,2) DEFAULT NULL,
  `objdesc` text DEFAULT NULL,
  `objref` varchar(50) DEFAULT NULL,
  `objprix` double(6,2) DEFAULT -1.00,
  `ediid` int(11) NOT NULL,
  `typeid` int(11) NOT NULL,
  `objannee` int(11) DEFAULT NULL,
  `objmois` int(11) DEFAULT NULL,
  `objdatecreation` datetime NOT NULL DEFAULT current_timestamp(),
  `objdateupdate` datetime DEFAULT NULL,
  `objpoids` int(11) DEFAULT NULL,
  `rangement` varchar(45) DEFAULT NULL,
  `mt_achat` float DEFAULT NULL,
  `possede` int(11) DEFAULT NULL,
  `detail_sur_possession` text DEFAULT NULL,
  `objactif` tinyint(1) NOT NULL DEFAULT 0,
  PRIMARY KEY (`objid`),
  KEY `fk_series_idx` (`serid`),
  KEY `fk_editeurs_idx` (`ediid`),
  KEY `fk_type_idx` (`typeid`),
  CONSTRAINT `fk_editeurs` FOREIGN KEY (`ediid`) REFERENCES `editeurs` (`ediid`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_series` FOREIGN KEY (`serid`) REFERENCES `series` (`serid`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_type` FOREIGN KEY (`typeid`) REFERENCES `types` (`typeid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1690 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

