r l\'achat d\'une paire de chaussures Tintin dans les magasins BATA',NULL,0.00,50,2,1967,NULL,'2021-06-28 22:03:14',NULL,NULL,NULL,NULL,0,NULL,1),(1386,120,'01 l’hydravion jaune du crabe aux pinces d’or',NULL,'Extrait du livret : ... L\'hydravion jaune d\'Hergé est une pure merveille d\'ingénierie aéronautique. La disposition de son fuselage est empreintée au Bellanca, ses flotteurs font penser au Seversky et sa voilure au Stinson R-10 Reliant. Quant à son capot, il ressemble étrangement au célèbre dispositif NACA mis au point dans les années 20.','29521',2.99,51,18,2014,1,'2021-09-18 21:53:01','2021-09-19 13:50:22',NULL,'Etagère',NULL,1,NULL,1),(1387,120,'02 le Carreidas 160 de vol 714 pour Sydney',NULL,'Extrait du livret : ...le dessinateur Roger Leloup a réalisé pour Hergé un croquis très détaillé du Carreidas 160. Tout comme le chasseur-bombardier General Dynamics F-111 dont il s\'inspire, le Carreidas 160 est un avion équipé d\'ailes à géométrie variable. Il est immatriculé au Royaume-Uni avec l\'identifiant fictif G-CATF. Sur la dérive, un diamant avec le carré d\'as du poker fait référence au nom de son propriétaire !','29522',8.99,51,18,2014,1,'2021-09-18 22:04:07',NULL,NULL,'Etagère',NULL,1,NULL,1),(1388,120,'03 à l’hydravion jaune de l’étoile mystérieus',NULL,'Extrait du livret : ...Hergé a pris comme modèle l\'Arado 196, utilisé depuis les années 30 par la plupart des navires de guerre de la marine allemande. Depuis les porte-avions, il décollait à l\'aide d\'une catapulte et pouvait se maintenir en vol pendant plus de quatre heures. C\'est à son bord et par la voie des airs que Tintin va distancer l\'expédition américaine du Peary et atteindre le premier le fameux aérolithe tellement convoité.','29523',19.99,51,18,2014,2,'2021-09-18 22:06:42','2021-09-19 14:14:31',NULL,NULL,NULL,0,NULL,1),(1389,120,'04 l’hydravion bleu de cock en stock',NULL,'Extrait du livret : ... Rastapopoulos, veut torpiller le SS Ramona, cargo sur lequel Haddock se trouve en compagnie de Tintin. Leur appel de détresse est capté par la croiseur américain USS Los Angeles CA-135 qui envoit deux hydravions CurtissSC-1 Seahawk pour venir en aide au Ramona.','29524',19.99,51,18,2014,3,'2021-09-18 22:08:22','2021-09-19 14:19:23',NULL,NULL,NULL,0,NULL,1),(1390,120,'05 l’hydravion jaune des 7 boules de cristal',NULL,'Hergé a dessiné le Short Sunderland civil en utilisant pour référence les photos d\'un modèle militaire.\r\nPour représenter en transport civil dans son récit, il a effacé les canons dépassant des tourelles avant et arrière, mais a maintenu celles-ci pourtant totalement absentes de la version civile.','29525',19.99,51,18,2014,3,'2021-09-18 22:10:23',NULL,NULL,NULL,NULL,0,NULL,1),(1391,120,'06 le biplan jaune de Tintin au Congo',NULL,'Extrait du livret : Le biplan jaune qui vole au secours de Tintin au Congo n\'est autre que L\'Udet U-12 Flamingo.\r\nSur ses flancs, Hergé a dessiné la silhouette d\'un oiseau semblable à la grue conçue pour la compagnie aérienne Deutsche Lufthansa. Toutefois, le Flamingo de Tintin au Congo est une version spéciale. Sa capacité en carburant a été augmentée. On y a également installé un moteur avec des cylindres en ligne refroidis à l\'eau. Hergé laisse apparaître les trois fentes de refroidissement dans la partie arrière du capot.','29526',19.99,51,18,2014,3,'2021-09-19 08:56:36','2021-09-19 14:59:17',NULL,NULL,NULL,0,NULL,1),(1392,120,'07 l’avion orange des cigares du pharaon',NULL,'Le monoplan dont Hergé s\'est inspiré est le De Havilland DH 80 Puss Moth, offert par la société De Haviland au roi Faycal, qui a combattu pendant la Première Guerre mondiale aux côtés du capitaine Lawrence d\'Arabie.','29527',19.99,51,18,2014,4,'2021-09-19 08:59:29','2021-09-19 15:01:23',NULL,NULL,NULL,0,NULL,1),(1393,120,'08 c’est l’avion rouge de L’île noire',NULL,'Extrait du livret:Le petit avion rouge qu\'Hergé lance à la poursuite de Müller dans l\'Île noire est un authentique Bristol Chipmunk. Conçu et fabriqué au Canada après la Seconde Guerre mondiale, il doit son nom à un petit écureuil rayé typique de ce pays. Sa grande maniabilité et ses qualités de vol exceptionnelles en firent un avion de prédilection des écoles d\'entrainement de la Royal Air Force, des aéroclubs et surtout des adeptes de l\'acrobatie aérienne.','29528',19.99,51,18,2014,4,'2021-09-19 09:00:42',NULL,NULL,NULL,NULL,0,NULL,1),(1394,120,'09 l’avion de chasse de Tintin au pays des soviets',NULL,'Tintin effectue son baptême de l\'air sur le Polikarpov L-1 au dessus de la steppe enneigée de l\'URSS.','29529',19.99,51,18,2014,5,'2021-09-19 09:02:13','2021-09-19 17:13:05',NULL,NULL,NULL,0,NULL,1),(1395,120,'10 l’avion de la force aérienne du Khemed de coke en stock',NULL,'Les Mosquitos DH 98 aux ordres de Mull Pacha vont s\'acharner sur Tintin...','29530',19.99,51,18,2014,5,'2021-09-19 09:03:22',NULL,NULL,NULL,NULL,0,NULL,1),(1396,120,'11 Le biplan jaune de L’île noire',NULL,'Biplan ( G-AIR) dont les acrobaties ont bien remué les Dupondt dans l\'Île noire.','29531',19.99,51,18,2014,6,'2021-09-19 09:08:39',NULL,NULL,NULL,NULL,0,NULL,1),(1397,120,'12 le Douglas DC-3 de Tintin au Tibet',NULL,NULL,'29532',19.99,51,18,2014,6,'2021-09-19 09:09:48',NULL,NULL,NULL,NULL,0,NULL,1),(1398,120,'13 l’avion de reconnaissance de coke en stock',NULL,'Cet avion doit localiser le cargo Ramona sur lequel se trouve Tintin.','29533',19.99,51,18,2014,7,'2021-09-19 13:32:07','2021-09-19 20:06:07',NULL,NULL,NULL,0,NULL,1),(1399,120,'14 l’avion de bazaroff de l’oreille cassée',NULL,'Bazaroff, marchand d\'armes, utilise cet avion (un Wibault 360) comme bureau volant.','29534',19.99,51,18,2014,7,'2021-09-19 13:33:36',NULL,NULL,NULL,NULL,0,NULL,1),(1400,120,'15 le Boeing 707 de la Qantas vol 714 pour Sydney',NULL,'Dernière escale de Tintin et ses amis pour rejoindre le congrès international d\'astronautique...','29535',19.99,51,18,2014,8,'2021-09-19 13:34:58',NULL,NULL,NULL,NULL,0,NULL,1),(1401,120,'16 le chasseur bordure du sceptre d’Ottokar',NU