INSERT INTO `personnages` VALUES (1,'Abdallah','Ben Kalish Ezab','Abdallah','M','ABDALLAH.PNG','Fils unique et turbulent de son altesse Mohammed Ben Kalish Ezab, Roi du Khemed.'),(2,'Allan','Thompson','Allan','M','ALLAN.PNG','Marin américain qui travaille souvent pour Rastapopoulos.'),(3,'Bianca','Castafiore','La Castafiore','F','LA CASTAFIORE.PNG','Cantatrice Italienne surnommée le Rossignol Milanais.\r\nApparait dans le Sceptre d\'ottokar.'),(4,'-','-','Le champignon','','LE CHAMPIGNON.PNG',''),(5,'-','Finney','Docteur Finney','M','DOCTEUR FINNEY.PNG','Médecin anglais qui ordonne l\'internement de Tintin pour folie.'),(6,'','Dupon','Dupond','M','DUPOND.PNG','Policier belge, meilleur ami de Dupont.\r\nSa moustache arrondie vers l’intérieur.\r\nApparait dans les cigares du Pharaon.'),(7,'','','Dupont','M','DUPONT.PNG','Policier belge, meilleur ami de Dupond.\r\nSa moustache recourbée vers l’extérieur.\r\nApparait dans les cigares du Pharaon.'),(8,'','','Le fétiche Arumbaya','','LE FéTICHE ARUMBAYA.PNG','Apparait dans l\'Oreille Cassée'),(9,'','','La fusée lunaire','','LA FUSéE LUNAIRE.PNG',''),(10,'','','Grand Brigand','M','GRAND BRIGAND.PNG','Brigand à la solde de Rastapopoulos dans le lac aux requins'),(11,'','','Gustav','M','GUSTAV.PNG',''),(12,'Archibald','Haddock','Capitaine Haddock','M','CAPITAINE HADDOCK.PNG','Marin, meilleur ami de Tintin'),(13,'François','de Hadoque','Chevalier François de Hadoque','M','CHEVALIER FRANçOIS DE HADOQUE.PNG','Capitaine de la marine du roi, commandant du vaisseau La Licorne'),(15,'Mohammed','Ben Kalish Ezab','L\'Emir','M','LEMIR.PNG','Emir du Khemed. Père d\'Abdallah.\r\nApparait dans Tintin au Pays de l\'or noir'),(16,'','','Le Colonel','M','LE COLONEL.PNG','Apparait dans les Cigares du Pharaon\r\nOn ne connait ni son nom ni son prenom.\r\nMembre des Frères de Kih-Oskh'),(17,'','Sponsz','Colonel Sponsz','M','COLONEL SPONSZ.PNG','Chef de la police secrète Bordure.\r\nApparait dans l\'Affaire Tournesol.'),(18,'','Cipaçalouvishni'