INSERT INTO `series` VALUES (1,'LU 94',1994,NULL,'Seconde série de trois nouvelles figurines extraites de l\'épopée lunaire est offerte dans chaque lot de trois paquets de biscuits Prince.\r\nsouple.\r\nInscription : CE © Hergé 1994 TL LU.  LU offrait la même année dans d\'autres paquets de biscuits : un Milou à emboiter sur un crayon  Et pour 2 paquets de HELLO, LU offrait aussi un porte-clefs de la Fusée Lunaire. \r\nA noter qu\'un cratère en PVC orange et vert servant à poser Milou aurait été produit avec un marquage « Hergé », je n\'ai trouvé cette information qu\'une seule fois sur Internet mais sans photo.','http://ma-collection-tintin.blogspot.com/2013/10/figurines-tintin-bully-pib-1975-cette.html\r\nChacune des figurines de cette série était donnée gratuitement, en achetant un ensemble de trois paquets de gâteaux «Prince». Elle comprend 3 figurines différentes. Dans d\'autres produits, LU ajouta d\'autres figurines : un grand Milou percé en dessous permettant de le fixer au bout d\'un crayon et un porte clés fusée. Figurines peintes à la main en plastique souple. H. 26 à 70 mm. Marquage : © Hergé 1994 LU. A noter qu\'un cratère en PVC orange et vert servant à poser Milou a été produit avec un marquage « Hergé ».'),(2,'LU 93',1993,NULL,'En 1993, dans chaque lot de trois paquets de biscuits \"Prince\" se trouve l\'une des trois figurines suivantes. \r\nInscription sous les pieds : LU © HERGE. \r\nPour l\'envoi de 3 codes barres et un chèque de 20 francs, on reçoit une quatrième figurine de Tournesol de BULLY de l\'année 1990.','http://ma-collection-tintin.blogspot.com/2013/10/figurines-tintin-bully-pib-1975-cette.html\r\nLa série LU 93 comprend 3 figurines en plastique dur, qui étaient ajoutés gratuitement à quelques produits de la marque LU, et avec 3 preuves d\'achat de ces produits ont pouvait recevoir une quatrième figurine Tournesol, qui est en fait celle de la série «Bully 90».\r\nFigurines peintes à la main en plastique rigide. H. 25 à 86mm.\r\nMarquage : © Hergé LU.\r\nCette figurine était une prime qui accompagnait les petits beurres de la marque Lu. \r\nElle est dans son sachet céllophane d\'origine qui était placé sur le paquet , bien visible , à la merci des vols et détournements faciles et fréquents en grande distribution. \r\nLa série etait constituée de Tintin astronaute, Milou astronaute, ainsi que de Dupond et Dupont astronautes. \r\n'),(3,'SCHLEICH 1985',1985,NULL,'Cette série comprend 6 personnages peints à la main.\r\nMarquage : © HERGE SCHLEICH différent sur chaque figurine.\r\nSérie rééditée début des années 90. Je ne sais pas si les photos sont de l\'ancienne ou la nouvelle édition.','http://ma-collection-tintin.blogspot.com/2013/10/figurines-tintin-bully-pib-1975-cette.html\r\nFigurines Schleich - 1985'),(4,'BULLY PIB',1977,NULL,'Cette série est appelée BULLY PIB, à cause de l\'inscription ©PIB dans le dos de chaque figurine.','http://tin-7.soforums.com/t107-collection-figurines-BULLY.htm\r\nDans ces séries, il y a d\'autres séries, dont deux, 1975 et 1977,  sorties avec les chaussures ROUGES pour Haddock et Tournesol ( et lui même possède en fonction de sa série, un manteau qui va du vert clair ou vert sombre), et une autre série, avec pour les Dupondt, des chaussures NOIRES. \r\n( donc la première série de 1975 ci dessus, Tournesol n\'est pas dans la bonne serie, il lui faut les chaussures rouges)\r\n\r\nIl y aurait une série avec un seul changement, le Tintin au sac à dos, tous les autres étant identiques à la série 1975/1977.\r\n\r\nLes marques ont eu droit de diffusion de cette série de Six, comme Lu ou Esso avec plus ou moins de bonheur....\r\n\r\nBeaucoup mélangent, involontairement, leurs figurines sans savoir qu\'ils ont ainsi deux ou trois séries. (Moi le premier, c\'est en chinant que je suis tom e sur un Tintinophile belge qui m\'a taclé grave (mais gentiment) sur les series. \r\n\r\nIl existe des séries, sorties de par le Monde, avec plus ou moins de réussite, mais non reconnues par \"la maison mere\" et donc Collector pour les fans. \r\nD\'autant que les séries pvc posterieures, suivant le pays, n\'ont pas les même couleurs.  Cool \r\n(Tintin l\'ile noire, en Europe et au Canada, n\'a pas le même kilt!!!)\r\n\r\nC\'était juste un complément pour ceux qui rangent leurs personnages par séries...\r\n\r\nTintinement votre\r\n\r\nhttps://tintinophile.weebly.com/bully.html\r\nBully 1975\r\nPersonnages représentés : Tintin, Milou, Haddock, Tournesol, Dupont, Dupond.\r\nDescription : 6 figurines peintes à la main en plastique souple. Vendues à l\'unité. H. 31 à 61 mm.\r\nMarquage : © Bully PIB (certaines ont un sticker collé au dos annonçant \"peintes à la main Bully Allemagne de l\'Ouest\").\r\nPrix constatés : de 8 à 20 € environ pièce. Attention, l\'estimation des deux Dupont(d), dont les cannes amovibles sont facilement perdues, peut dépasser cette fourchette de prix.\r\n\r\nMes notes :\r\nFondée en 1973, l\'entreprise Bullyland fabrique en 1977 sa première série Tintin.\r\nElle est aussi appelée BULLY PIB, à cause de l\'inscription ©PIB sur chaque figurine.\r\nIl faut noter que Tournesol (5.9 cm) reviendra sous la même forme en 1985 avec l\'édition Comics Spain mais il mesurera 7.9 cm.\r\n'),(5,'BRABO',1979,NULL,'Série de 1979 commandé par les éditions du Lombard. \r\nCe sont des figurines flexibles en plastique souple.\r\nLa société VICMA rééditera Tintin et Milou.',''),(6,'BULLY',1990,NULL,'Cette série comporte les inscriptions suivantes:\r\nSous le pied gauche : CE BULLY\r\nSous le pied droit : © HERGE\r\nLe plastique est légèrement souple.','https://tintinophile.weebly.com/bully.html\r\nBully 1990\r\nPersonnages représentés : Tintin, Milou, Haddock, Tournesol, Dupont, Dupond.\r\nDescription : 6 figurines peintes à la main en plastique souple ou rigide. Vendues à l\'unité. H. 35 à 81 mm.\r\nMarquage : © Hergé Bullyland ou Hergé Bully.\r\nRemarques : cette série a donné lieu à deux séries identiques mais dans un plastique différent, souple ou rigide. Des variantes de couleurs sont également constatées, l\'os de Milou passant du jaune pour la série souple au rose pour la série rigide. La série souple porte la mention \"Hergé-Bully\" au pied des personnages, la série dure est gravée \"Hergé-Bullyland Made in Germany\" au dos. Ces figurines ont aussi été reprises en porte-clés. \r\nPrix constatés : de 5 à 15 € environ pièce, quelle que soit la série.\r\n\r\nhttp://ma-collection-tintin.blogspot.com/2013/10/figurines-tintin-bully-pib-1975-cette.html\r\n\r\n6 figurines peintes à la main en plastique souple ou rigide. H. 35 à 81mm.\r\nLa série de figurines «Bully 90» est en fait composée de deux séries de figurines :\r\n- l\'une ayant un marquage sous les pieds : © HERGE CE BULLY (série souple)\r\n- l\'autre ayant un marquage dans le dos: © HERGE CE BULLY MADE IN GERMANY (série dure)\r\nSeule la figurine Tintin a de grandes différences de couleurs. Milou existe quant à lui en plusieurs variétés toutes marquées: © HERGE CE BULLY MADE IN GERMANY\r\nCertaines de ces figurines ont été vendues avec une chaîne de porte clés.\r\n\r\nMes notes :\r\nFabriquée en 1990. C\'est la série que l\'on trouve le plus sur le marché. Mais pour les puristes (collectionneurs) il s\'avère que cette série est un casse-tête.\r\nS\'il n\'existe que 6 figurines, il y a eu bon nombre de production qui diffèrent par les inscriptions et leur materiau. J\'ai pu constater 4 series :\r\n© HERGE  CE BULLY\r\nVoilà, je pense la première série éditée. Même si pour Milou il reste un doute.\r\nPour les autres personnages : inscription sous les pieds © HERGE  CE BULLY\r\n© HERGE CE BULLY MADE IN GERMANY\r\nFigurine en plastique souple qui diffère de la version originale par la couleur des vêtements.\r\nL\'inscription au dos est : © HERGE CE BULLY MADE IN GERMANY\r\n© HERGE CE BULLYLAND MADE IN GERMANY SOUPLE\r\nFigurines en plastique souple qui diffèrent de la version originale pour Tournesol :\r\nle pommeau de son parapluie est noir au lieu de marron.\r\nLes traits de personnages sont moins marqués (plus lissés) que la version originale.\r\nL\'inscription au dos est : © HERGE CE BULLYLAND MADE IN GERMANY\r\n© HERGE CE BULLYLAND MADE IN GERMANY DUR\r\nFigurines en plastique dur qui diffèrent par les couleurs pour Tintin.\r\nLe plastique est plus mat que la version souple.\r\nL\'inscription au dos est : © HERGE CE BULLYLAND MADE IN GERMANY\r\n'),(7,'BULLYLAND DUR',1990,NULL,'Inscription Bullyland Made in Germany dans le dos , plastique rigide qu’on ne peut pas plier. Si la figurine tombait elle pourrait casser.',''),(8,'BULLYLAND SOUPLE',1990,NULL,'Edité en 1990 cette série a l\'inscription Bullyland Made in Germany dans le dos.\r\nPlastique souple que l\'on peut légèrement tordre.',''),(9,'BULLY MADE IN GERMANY',1990,NULL,'Cette série de 1990 comporte l\'inscription © HERGE CE BULLY MADE IN GERMANY dans le dos des figurines.',''),(10,'Carrefour Market 2011',2011,NULL,'Cette série est produite par TCC Continuity Holding N.V à l\'occasion de la sortie du film de Spielberg.\r\nDifférentes offres seront faites de octobre à novembre 2011.\r\nPour un montant d\'achat minimum dans les magasins des figurines sont offertes. \r\nSinon des timbres sont offerts, et le cumul de timbres vous permet d\'échanger contre une figurine.',''),(11,'Casterman Citel',NULL,NULL,'',''),(12,'CGI',1986,NULL,'Série fabriquée en 1986 à Hong-Kong pour LOMBARD.\r\nPoupée en plastique de 27cm.\r\n10 tenues étaient également vendues séparément.',''),(13,'CITEL 95',1995,NULL,'En 1995, la société CITEL sort des portes-clefs Tintin',''),(14,'Citel Video PFC Video',NULL,NULL,'',''),(15,'Collection REV / Hachette Video',NULL,NULL,'',''),(16,'COMICS SPAIN',1985,NULL,'Cette série commandée par les Editions du Lombard porte le nom du fabriquant Espagnol.\r\nLes dates inscrites sont très difficiles à déchiffrer. Elles pourraient être de 84 / 85 / 86 / 89.',''),(17,'Coffret Couverture',NULL,NULL,'4 Coffrets sortent entre 2005 et 2008, représentants 4 couvertures d\'album.',''),(18,'DELACOSTE 1967',1967,NULL,'Série fabriquée en 1967. Elle sera surmoulé pour la série LAYA','http://www.ruedulabrador.com/fr/figurines-anciennes/497-rarissime-figurine-tournesol-delacoste-1967-.html'),(19,'En voiture Tintin, série 1',2001,9,'Série qui comprend 70 modèles.\r\nPublié entre 2001 et 2007.\r\nSera réédité en 2012 avec un socle orange, appellée \"2ème série\".\r\nEchelle 1/43',''),(20,'ESSO Belvision',1973,NULL,'En 1973, les stations-service Esso françaises offrent une série de personnages inspirés du film « Le Lac aux requins » mais différente de celle distribuée en Belgique : plus petite, en couleurs et aux personnages moins nombreux. A la différence de la série belge, un seul Dupond(t) fut produit ; Madame Vlek et les acolytes de Rastapopoulos ne sont plus représentés.','http://ma-collection-tintin.blogspot.com/2013/10/figurines-tintin-bully-pib-1975-cette.html\r\nFigurines Heimo EdL - 1974\r\n\r\nCette série fabriquée par Heimo comprend 6 personnages. 6 figurines peintes à la main en plastique rigide.\r\nCette série était vendue complète dans une boite en carton et est aussi connue sous le nom de EdL (Editions du Lombard).\r\nMarquage : © EdL. H. 22 à 60mm.\r\nCette série a été rééditée plus tard au Portugal par Livraria Bertrand dans un présentoir carton noté « Tintin e companhia ». Ces figurines sont moulées dans un plastique plus souple et les couleurs sont plus foncées (pantalon rouge pour Tintin).\r\n\r\nhttp://tin-7.soforums.com/t119-serie-figurines-HEIMO.htm\r\n\r\ncette série de figurine s\'appelle HEIMO (?) mais a été commandée par Le Lombard en 1972, \r\n\r\nune réédition a ensuite été commandée par un libraire au portugal avec de légères différences.\r\n\r\nvisuel de la série Le Lombard :'),(21,'Belvision',1973,NULL,'Même série que ESSO Belvision sans le marquage ESSO, je ne sais pas si la série initiale a été produite entièrement avec ce marquage.',''),(22,'ESSO BLANC',1973,0,'Série belge spour rassembler les objets qui concernent les 6 séries monochromes',''),(23,'ESSO BLEU',1973,NULL,'Série belge sortie en 1974 après la sortie du film : Tintin et le Lac aux requins.\r\nComprend 16 figurines dans 6 couleurs différentes.',''),(24,'ESSO JAUNE',1973,NULL,'Série belge sortie en 1974 après la sortie du film : Tintin et le Lac aux requins.\r\nComprend 16 figurines dans 6 couleurs différentes.',''),(25,'ESSO MAUVE',1973,NULL,'Série belge sortie en 1974 après la sortie du film : Tintin et le Lac aux requins.\r\nComprend 16 figurines dans 6 couleurs différentes.',''),(26,'ESSO ROUGE',1973,NULL,'Série belge sortie en 1974 après la sortie du film : Tintin et le Lac aux requins.\r\nComprend 16 figurines dans 6 couleurs différentes.',''),(27,'ESSO VERT',1973,NULL,'Série belge sortie en 1974 après la sortie du film : Tintin et le Lac aux requins.\r\nComprend 16 figurines dans 6 couleurs différentes.',''),(28,'Fèves Tintin le film',NULL,NULL,'',''),(29,'MIRIM TOYS',1958,0,'Série fabriquée en 1958. Aussi appelée Grand Pouet. \r\nIl existe Tintin pull bleu/jaune/rouge et Tintin saluant, Haddock, Dupond classique, Dupond avec foulard à pois, Tournesol et Milou.\r\nil existe aussi plusieurs versions de Milou :\r\n- la version de 20cm de haute possède ou pas des Tampons Tintin\r\n- une autre version fait seulement 10cm','À la demande d’Hergé, Nat Neujean est le premier sculpteur qui a donné du volume et de la vie à Tintin et Milou, ses héros d’encre et de papier.\r\nUne première sculpture de 20 cm fut créée en 1953 pour servir de modèle de base aux jouets pouêt-pouêt, de la marque MIRIM.\r\n\r\nOutre sa collection de jouets de cow-boys, EX.IN.CO (Extension Industrielle et Commerciale) propose dès le milieu des années 1950 des jouets en caoutchouc, sifflants. Ceux-ci sont à l\'effigie des héros des enfants de l\'époque, sortis tout droit des bandes dessinées et dessins animés : Popeye et Olive,\r\nPif, Tintin et ses amis, Lucky Luke, Spirou, Marsupilami... font ainsi la joie des petits qui peuvent les presser sans les abîmer. La société, basée à Paris, ne participe plus au Salon du Jouet à partir de 1969, ce qui semble le signe de sa cessation d\'activité.'),(30,'HEIMO',1972,NULL,'Série commandée par les éditions du Lombard en 1972. Elle sera réédité par la LIbrairie Bertrand quelques années plus tard avec quelques variations.','http://ma-collection-tintin.blogspot.com/2013/10/figurines-tintin-bully-pib-1975-cette.html\r\nFigurines Heimo EdL - 1974\r\n\r\nCette série fabriquée par Heimo comprend 6 personnages. 6 figurines peintes à la main en plastique rigide.\r\nCette série était vendue complète dans une boite en carton et est aussi connue sous le nom de EdL (Editions du Lombard).\r\nMarquage : © EdL. H. 22 à 60mm.\r\nCette série a été rééditée plus tard au Portugal par Livraria Bertrand dans un présentoir carton noté « Tintin e companhia ». Ces figurines sont moulées dans un plastique plus souple et les couleurs sont plus foncées (pantalon rouge pour Tintin).\r\n\r\nhttp://tin-7.soforums.com/t119-serie-figurines-HEIMO.htm\r\n\r\ncette série de figurine s\'appelle HEIMO (?) mais a été commandée par Le Lombard en 1972, \r\n\r\nune réédition a ensuite été commandée par un libraire au portugal avec de légères différences.\r\n\r\nvisuel de la série Le Lombard :'),(32,'Jeu de familles',NULL,NULL,'',''),(33,'Kids Cartoon',NULL,NULL,'',''),(34,'LAYA',1980,NULL,'Série édité en 1980, sur la base d\'un moulage de la série delacoste de 1967','Tirage d\'essais espagnole (photo moulage)\r\nTaille : 6,5 à 14cm  \r\nMatière : Caoutchouc \r\nAnnée : Années 80 \r\nOrigine : Espagne \r\nLa série comprends;Tintin, Milou, Haddock, Tournesol, Dupond et Dupont. \r\nA noter que Dupond et Dupont sont en fait les memes figurines. \r\nTradmarck lanco'),(35,'Les Voyages de Tintin',NULL,NULL,'',''),(36,'Livraria Bertrand',1980,NULL,'Reproduction de la série Heimo (1974) par la librairie portugaise Livraria Bertrand dans les années 1980.\r\nCes reproductions sont facilement reconnaissables car les mains et les visages sont peints.\r\nDe plus certaines couleurs ne sont identiques.\r\nMarqué EDL au dos : Editions Du Lombard','tournesol : pommeau de parapluie brun ou noir\r\ndupontd : chaussures brunes ou noires sourcil absent et couleur canne plus claire\r\ntintin : pantalon rouge parfois\r\nCes figurines pvc fabriquées au Portugal sous licence Librairie Bertrand,\r\nsont identiques aux figurines plastiques de chez Heimo, mais légèrement plus petite. \r\nle collectionneur chineur numero 3 de novembre 2006 ou il marque le vrai prix des figurines TINTIN \r\npage 38 editions HEIMO_DELACOSTE 1974 les figurines sont en plastique rigide marquage EdL \r\net ont été réédité au Portugal en plastique plus souple \r\nprix constatés:série d origine de 15 à 30 euros pièce \r\nsérie rééditée:de 30 à 45 euros toute la série \r\n'),(37,'Mc Donald\'s',2011,0,'Figurines offertes avec un Happy Meal suite à la sortie du film de Steven Spielberg et Peter Jackson le 26 octobre 2011.\r\nCe programme Happy Meal comprend 10 jouets qui permettent de resoudre le mysterieux secret.','http://tin-7.xooit.fr/t79-Tintin-chez-McDonald-dans-le-Happy-Meal-2011.htm\r\nhttp://passion-collections.superforum.fr/t3546-figurines-tintin-mc-donald'),(38,'ML 2003',2003,NULL,'',''),(39,'ML 2004',2004,NULL,'',''),(40,'ML 2005',2005,NULL,'',''),(41,'ML 2010 Grand',2010,6,'Sortie en Juin 2010, cette série existe aussi en petit modèle',''),(42,'ML 2010 Petit',2010,6,'Sortie en Juin 2010, cette série existe aussi en grand modèle',''),(43,'ML 2010 Petit - PC',2010,0,'Cette série existe aussi en grand modèle',''),(44,'ML 2010 Grand - PC',2010,0,'Cette série existe aussi en petit modèle',''),(45,'ML 2011 Petit',2011,NULL,'Cette série existe aussi en grand modèle',''),(46,'ML 2011 Grand - PC',2011,0,'Cette série existe aussi en petit modèle',''),(47,'ML 2011 Petit - PC',2011,0,'Cette série existe aussi en grand modèle',''),(48,'ML 2012 Petit',2012,NULL,'Cette série existe aussi en grand modèle',''),(49,'Tintin et les voitures',NULL,NULL,'',''),(50,'TYCO',1995,NULL,'Série de poupée de 1995.',''),(51,'UGC',NULL,NULL,'',''),(52,'ML 2020',2020,1,'',''),(53,'Tintin transports',2008,7,'',''),(54,'VICMA',1982,NULL,'Réédition des figurines Brabo',''),(55,'ML 2019',2019,NULL,'',''),(56,'JIM - PC',0,0,'Les premières figurines en porte-clés semblent être celles produites par JIM dans les années 1960.\r\nIl existe deux modèles de Tintin : l’un de 62 mm et un plus petit de 53 mm avec un Milou collé, souvent disparu aujourd’hui.\r\nHaddock figure en deux versions de 65 et 62 mm, la dernière le représentant avec un perroquet rouge sur l’épaule.\r\nMarc Noël (La Vie du Jouet – N°93 – Octobre 2003)',''),(57,'PINATERIA BLEU',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.','Offert en 1971, 20 figurines représentant divers personnages de la série Tintin (marqué au dos \"Stenval-Lombard\" d\'environ 3 cm de haut)\r\nAttention aux rééditions de 1992 Colombiennes (marqué \"inteco Pinateria\") mais quand même super interessante car environ une quinzaine de figurine supplémentaires et différentes par rapport à celles distribuées en France !\r\nmarque pininteria intenco tres tres rare de 1992,c est une reedition de la marque stenval\r\n'),(58,'PINATERIA JAUNE',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.',''),(59,'PINATERIA JAUNE FLUO',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.',''),(60,'PINATERIA ORANGE FLUO',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.',''),(61,'PINATERIA ROSE FLUO',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.',''),(62,'PINATERIA ROUGE FLUO',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.',''),(63,'PINATERIA VERT FLUO',1992,NULL,'Pinateria Inteco réédite en  1992 les figurines Stenval de 1971.\r\nLes couleurs sont très différentes des originales et les figurines n\'ont pas de marquages.',''),(64,'PLASTOY 2011 ACTION',2011,0,'',''),(66,'PLASTOY 2011 LICORNE',2011,10,'',''),(67,'PLASTOY 2011 MOTO',2011,10,'',''),(69,'PLASTOY 2011 TUBE + HYDRAVION',2011,10,'Cette série sort dans 2 packaging différent :\r\n\r\n- Un tube avec uniquement les figurines\r\n- Un coffret avec en plus des figurines un Hydravion\r\n\r\n- Inscription au dos des figurines :\r\n&copy Paramount Pictures\r\nCHINA\r\nPLASTOY',''),(70,'PLASTOY 1994',1994,NULL,'Fabriquées pour la première fois en 1994, cette série sera produite jusqu\'en 1997. Elle est maintenant épuisée. \r\nElle comprends 11 figurines où est inscrit sur chaque ©HERGE 1994 TL PLASTOY CE ',''),(71,'SICA-TOYS',1959,0,'Série éditée en 1959.\r\nAussi appellée Petit Pouet car légèrement plus petites que la série Mirim.',''),(72,'Coffret Scène',NULL,NULL,'Des coffrets représentants des scènes des albums sortent entre 2006 et 2011',''),(73,'STENVAL BLANC',1971,NULL,'Cette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nD\'environ 3cm, elles sont marquées Stenval © Lombard et TITO dans un losange au dos.\r\nElle représente 20 personnages des aventures de Tintin.','Offert en 1971, 20 figurines représentant divers personnages de la série Tintin (marqué au dos \"Stenval-Lombard\" d\'environ 3 cm de haut)\r\nAttention aux rééditions de 1992 Colombiennes (marqué \"inteco Pinateria\") mais quand même super interessante car environ une quinzaine de figurine supplémentaires et différentes par rapport à celles distribuées en France !\r\nmarque pininteria intenco tres tres rare de 1992,c est une reedition de la marque stenval.\r\nhttp://tin-7.soforums.com/t121-collection-figurines-STENVAL.htm\r\nCette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nCe sont des figurines de 2-3 cm en plastique, monochromes, existantes dans 7 couleurs différentes : Blanc, Bleu, Jaune, Mauve, Orange, Rouge et Vert. au dos on peut lire : Stenval © Lombard. \r\nil existe 20 figurines différentes déclinées dans les 7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTintin, Milou, Haddock, Tournesol, Nestor, Dupondt, Castafiore, Allan, Rastapopoulos, Abdallah, emir ben Kalish Ezab, Oliveira da figueira, Wang Jen-Ghié, fakir cigares du pharaon, Philémon Siclone, colonel cigares du pharaon, Zorrino, Rackham le Rouge'),(74,'STENVAL BLEU',1971,NULL,'Cette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nD\'environ 3cm, elles sont marquées Stenval © Lombard et TITO dans un losange au dos.\r\nElle représente 20 personnages des aventures de Tintin.','Offert en 1971, 20 figurines représentant divers personnages de la série Tintin (marqué au dos \"Stenval-Lombard\" d\'environ 3 cm de haut)\r\nAttention aux rééditions de 1992 Colombiennes (marqué \"inteco Pinateria\") mais quand même super interessante car environ une quinzaine de figurine supplémentaires et différentes par rapport à celles distribuées en France !\r\nmarque pininteria intenco tres tres rare de 1992,c est une reedition de la marque stenval.\r\nhttp://tin-7.soforums.com/t121-collection-figurines-STENVAL.htm\r\nCette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nCe sont des figurines de 2-3 cm en plastique, monochromes, existantes dans 7 couleurs différentes : Blanc, Bleu, Jaune, Mauve, Orange, Rouge et Vert. au dos on peut lire : Stenval © Lombard. \r\nil existe 20 figurines différentes déclinées dans les 7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTintin, Milou, Haddock, Tournesol, Nestor, Dupondt, Castafiore, Allan, Rastapopoulos, Abdallah, emir ben Kalish Ezab, Oliveira da figueira, Wang Jen-Ghié, fakir cigares du pharaon, Philémon Siclone, colonel cigares du pharaon, Zorrino, Rackham le Rouge'),(75,'STENVAL JAUNE',1971,NULL,'Cette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nD\'environ 3cm, elles sont marquées Stenval © Lombard et TITO dans un losange au dos.\r\nElle représente 20 personnages des aventures de Tintin.','Offert en 1971, 20 figurines représentant divers personnages de la série Tintin (marqué au dos \"Stenval-Lombard\" d\'environ 3 cm de haut)\r\nAttention aux rééditions de 1992 Colombiennes (marqué \"inteco Pinateria\") mais quand même super interessante car environ une quinzaine de figurine supplémentaires et différentes par rapport à celles distribuées en France !\r\nmarque pininteria intenco tres tres rare de 1992,c est une reedition de la marque stenval.\r\nhttp://tin-7.soforums.com/t121-collection-figurines-STENVAL.htm\r\nCette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nCe sont des figurines de 2-3 cm en plastique, monochromes, existantes dans 7 couleurs différentes : Blanc, Bleu, Jaune, Mauve, Orange, Rouge et Vert. au dos on peut lire : Stenval © Lombard. \r\nil existe 20 figurines différentes déclinées dans les 7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTinti