urs différentes : Blanc, Bleu, Jaune, Mauve, Orange, Rouge et Vert. au dos on peut lire : Stenval © Lombard. \r\nil existe 20 figurines différentes déclinées dans les 7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTintin, Milou, Haddock, Tournesol, Nestor, Dupondt, Castafiore, Allan, Rastapopoulos, Abdallah, emir ben Kalish Ezab, Oliveira da figueira, Wang Jen-Ghié, fakir cigares du pharaon, Philémon Siclone, colonel cigares du pharaon, Zorrino, Rackham le Rouge'),(80,'PLASTOY 1994 - PC',1994,0,'Cette série comprends les mêmes personnages que l\'édition figurine.\r\nLes figurines étaient vendues autour de 28francs soit aujourd\'hui environ 6€.',''),(81,'Carte de Voeux 1972',2019,NULL,'','Serie Moulinsart 2019\r\nEnviron 6 cm\r\nAlliage métal 1000ex de chaque avec cerytif numéroté'),(82,'ML 2003 - PC',2003,0,'Porte clefs de figurines éditées la même année',''),(83,'Willeb',NULL,NULL,'',''),(84,'JIM',1960,0,'Cette série de 1965 comprend 6 personnages et 2 porte-clefs. Les figurines sont en acétates de cellulose et peintes à la main par des travailleur à domicile, mais encore plus souvent par des prisonniers de droit commun. Elles étaient vendues au détail ou dans une boîte cartonnée représentant un théatre ( avec seulement Milou assis). Le marquage est  : ©Dargaud JIM qui se trouve dans un losange gravé sous les pieds des personnages. Par contre, Milou qui est trop petit est marqué par \"Dargaud\".','La composition de base était de l\'acétate de cellulose, et elles sortaient du moule dans un sale blanc cassé. Après elles étaient peintes par des travailleur à domicile, mais encore plus souvent par des prisonniers de droit commun. C\'était le bon temps ou les détenus pouvaient se faire un peu d\'argent de poche en suivant la principe de \" Le travail c\'est la santé \".\r\nLes prix pratiqués actuellement sont prohibitifs. Il faut compter près de 500€ pour une série complète ( sans les porte-clefs)\r\nHaddock 6 cm dargaud inscrit dans le dos\r\ndans cette série il y a deux milous mais visiblement un seul Dupondt\r\n\r\nhttp://tintinde7a77ans.free.fr/?Jim-1960\r\n\r\nDescription : 6 personnages en plastique rigide. Elles sont peintes à la main. Vendues au détail ou dans une boîte cartonnée représentant un théatre où Milou était présent.\r\nTintin et Haddock existent en porte-clés dans deux modèles différents (taille).\r\n Tintin en porte clé : Normallement, Milou est collé avec son maître Tintin mais, il est souvent manquant. \r\n Haddock : Le capitaine est représenté dans la dernière version avec un perroquet rouge sur l’épaule. (Faites attention il existe une autre marque de figurine représentant Haddock avec le perroquet donc vérifiez le marquages). Les personnages : Tintin, Milou assis, Milou marchant, Tournesol, Haddock, et un Dupont(d).\r\nMarquages : ©Dargaud JIM se trouve dans un losange gravé sous les pieds des personnages. Par contre, Milou qui est trop petit est marqué par \"Dargaud\".\r\nPrix moyen : 50€ à 80€ pièce. La série peut atteindre 400 à 500€.'),(85,'BULLY - PC',1990,0,'Cette série comporte la marque BULLY sous le pieds des figurines',''),(86,'BULLY MADE IN GERMANY - PC',1990,0,'Cette série comporte la marque BULLY sous le pieds des figurines et Made in Germany dans le dos',''),(87,'BULLY PIB - PC',1977,0,'Cette série est appelée BULLY PIB, à cause de l\'inscription ©PIB dans le dos de chaque figurine.',''),(88,'COMICS SPAIN - PC',1985,0,'Cette série de porte-clefs commandée par les Editions du Lombard porte le nom du fabriquant Espagnol.',''),(89,'ML 2015',2015,0,'',''),(90,'ML 2011 Grand',2011,NULL,'Cette série existe aussi en petit modèle',''),(91,'ML 2012 Grand',2012,NULL,'Cette série existe aussi en petit modèle',''),(92,'La Collection Officielle',2011,0,'Série en résine pour grand public qui compte le plus de figurines différentes. (111)\r\nLa série fut entièrement réédité quelques années plus tard sous le nom : Collection Résine.\r\nLa première édition n\'avait pas de référence. Mais le détail de la figurine était inscrit sous le socle. Tandis la seconde édition a un tampon Moulinsart.\r\nLe première édition fut diffusée par TF1.',''),(93,'La Collection Officielle - Hors Série',2011,0,'La série fut entièrement réédité quelques années plus tard sous le nom : Collection Résine.',''),(94,'ML 2015 Petit',2015,NULL,'Cette série existe aussi en grand modèle',''),(95,'ML 2017 Mini Buste',2017,0,'Série sortie en 2017.\r\nExiste aussi en porte-clefs',''),(98,'EX.IN.CO',1950,0,'Figurines de 12 cm fabriquées entre 1950 et 1966 dans une mousse de latex armée animable. Cette mousse contenait une armature en fil de fer. La mousse supporte mal le temps et le sec et les figurines en très bon état sont très rares. Seules celles conservées dans les sachets en plastique d\'origine sont en bon état.\r\nLe prix varie de 50 à 250€ suivant l\'état.',''),(99,'ML 2012 Grand - PC',2012,0,'',''),(100,'ML 2012 Petit - PC',2012,0,'',''),(101,'United Labels',2011,0,'Pour la sortie du film de Spielberg, United Labels sort un jeu de société type \'Petits Chevaux\' qui comprends les 4 fois les 4 figurines présentées',''),(102,'SERI',1986,0,'Séries de poupées fabriquées en Chine for SERI\r\nSous licence Hergé - Editions du Lombard : 39274',''),(103,'The Adventures of Tintin',2011,0,'Estampillée Moulinsart mais cela semble bien être de la contrefaçon chinoise, on les trouve sur AliExpress. Si vous avez des infos n\'hésitez pas à faire suivre',''),(104,'Quaker Oats',1966,0,'En 1966, Quaker Oats produit les Céréales P\'tis Trésors Tintin.\r\nDans cette boite de ce céréales, on y trouve Tintin ou Milou',''),(106,'Mascottes Cesar',1962,0,'Ensemble de 6 figures thermoformées.\r\nCes mascottes avaient vocation à être accrochées sur un mur. \r\nFabrication des atelier César vers 1962.',''),(107,'Collection Courant d\'air',2009,0,'Cette série ne comprends qu\'un objet. :-)',''),(108,'DELACOSTE 1968',1968,0,'Pas d\'informations sur cette série',''),(109,'OLA Jaune',1969,0,'Les figurines étaient offertes avec les pots de glace OLA en 1969. 7 couleurs : jaune, bleu, blanc, vert, orange ou rouge. L’inscription au dos est © LOMBARD TITO Série réédité 2 ans plus tard par Stenval en France.',''),(110,'ML 2017 Mini Bustes - PC',2017,0,'Série sortie en 2017.',''),(111,'ESSO Monochrome',1973,0,'Série pour rassembler les objets qui concernent les 6 séries monochromes.\r\n\r\nSéries comprenant 2 tirages de 8 figurines de 25 à 70 mm, monochrome en plastique rigide, de six couleurs (bleu, blanc, rouge, vert, violet, jaune), qui étaient offertes en cadeau pour 20 litres d’essence dans les stations service belges Esso.\r\nPersonnages représentés pour la 1ère série : Tintin, Niko, Nouchka, Rastapopoulos, Lieutenant de Rastapopoulos, Brigand petite taille, Brigand gros et le Plongeur.\r\nPersonnages représentés pour la 2ème série : Milou, Haddock, Tournesol, Dupont, Dupond, La Castafiore, Gustav et Madame Vlek\r\nPour 30 F, on pouvait acquérir deux décors en carton prédécoupé de 50 x 50 cm : le Laboratoire sous-marin de Rastapopoulos et la Villa.','ESSO Belgique (1973)\r\nFigurines ESSO Belgique comprenant 2 séries de 8 figurines de 25 à 70 mm, monochrome en plastique rigide, de six couleurs (bleu, blanc, rouge, vert, violet, jaune), qui étaient offertes en cadeau pour 20 litres d’essence dans les stations service belges Esso.\r\nPersonnages représentés pour la 1ère série : Tintin, Niko, Nouchka, Rastapopoulos, Lieutenant de Rastapopoulos, Brigand petite taille, Brigand gros et le Plongeur.\r\nPersonnages représentés pour la 2ème série : Milou, Haddock, Tournesol, Dupont, Dupond, La Castafiore, Gustav et Madame Vlek\r\nPour 30 F, on pouvait acquérir deux décors en carton prédécoupé de 50 x 50 cm : le Laboratoire sous-marin de Rastapopoulos « Dio1 » et la Villa « Dio 2 ».\r\nParticularité de cette série, il existe une 17ème figurine représentant un chien mystère…ressemblant à la fois à Gustav pour le corps et à Milou pour la tête.\r\nAutre particularité pour la 1ère série uniquement, il existe des variantes d’inscriptions concernant les logos ESSO, TITO et l’inscription BELVISION.\r\nEn effet le logo ESSO peut se retrouver en position horizontale ou en position verticale au dos de la figurine. De plus les dimensions du logo TITO et de l’écriture BELVISION peuvent également être différentes :\r\n« GL » : lorsqu’il y a présence d’un grand logo TITO alors BELVISION est inscrit en plus petit\r\n« pl » : à l’inverse lorsque le logo TITO est petit alors BELVISION est inscrit en plus grand\r\n\r\nLes sachets de la premièere serie atient leux la seconde serie rouge'),(112,'Fête du timbre 2000',2000,0,'',''),(113,'Calcomic Kitkit',1982,0,'Pour les editions du Lombard',''),(114,'Gund',1991,0,'Fin de la série en 1994',''),(115,'Yeti',0,0,'Année 60\r\nPeluches en fourrure.\r\nL\'intérieur du corps est en mousse et contient du fil de fer pour lui donner des attitudes et avec la tête est en latex creux.',''),(116,'Fruit d\'or',0,0,'',''),(117,'ML 2014 Monochrome',2014,0,'A l\'origine, figurines offertes pour l\'achat de 2 albums en 2014.\r\nCelles-ci seront rééditées quelques années plus tard par Moulinsart.','https://www.facebook.com/hashtag/moulinsartresineoffrepromo2014/?__gid__=932164233656369\r\n\r\nSérie MOULINSART RÉSINE reprend 2 personnages, Tintin Lotus et Abdallah, qui ont été offertes pour l\'achat de 2 albums. Chaque figurine est conditionnée dans une boîte cylindrique transparente en plastique de 11 x 11 x 10 ou 19 cm. La figurine n\'est pas limitée.\r\nLa figurine d’Abdallah, de 90 mm, a été offerte le 25 février 2014 et 7 teintes de couleur existent : Rouge, Jaune, Noire, Grise, Rouge Satin, Jaune Satin et Noire Satin.\r\nLa figurine de Tintin Lotus, de 120 mm, a été offerte le 21 mai 2014 et 4 teintes de couleur existent : Grise, Blanche, Ocre et Verte.\r\nParticularité de ces figurines-là, elles n\'ont jamais été diffusées au titre de la collection Tintin TF1 malgré leurs programmations dans la liste internet des figurines à paraître!\r\nEn fait ces figurines ont été annulées en 2012 dû à un défaut de qualité (a priori la peinture) incompatible avec le cahier des charges de TF1/MOULINSART.\r\nMais étant déjà fabriquées, peintes en Chine et livrées en France, elles ont été stockées quelque part en France pendant des années avant d\'être recyclées en monochrome et offertes dans les boutiques ou librairies lors d\'opérations promotionnelles.\r\nDès 2012, quelques-unes de ces figurines ont tout de même pu s’échapper de ce stock et on les a vu apparaître discrètement dans les vides greniers ou boutiques de bd/parabd spécialisées.'),(118,'En voiture Tintin, série 2',2012,0,'Cette série comprend les mêmes voitures que la série 1 mais pas sortie dans le même ordre.\r\nL\'emballage est désormais rouge et le socle de support orange.',''),(119,'Chaussures Tintin - PC',1967,0,'Porte-clefs offerts pour l\'achat de Chaussures Tintin dans les magasins BATA.',''),(120,'En Avion Tintin',2014,0,'Moulinsart S.A. et hachette ont sélectionnés pour vous les avions mythiques des Aventures de Tintin. Fidèle aux dessins des albums et conçu dans des matériaux de grande qualité, chaque avion est accompagné d’une figurine emblématique de l’aventure dont il est tiré.',''),(121,'HAPAX',0,0,'',''),(122,'STAR COMICS',0,0,'Ces figurines étaient vendues en kit à monter et à peindre. Peu furent vendues car elles étaient trop chères.\r\nInformations récupérées sur le site de vente aux encheres de Tessier Sarrou',''),(123,'Les Voitures de Tintin',2019,0,'Modèles à l\'échelle 1/24ème.\r\nLes véhicules sont les mêmes que les séries Atlas.\r\nL\'exception vient dans certaines représentations de s personnages',''),(124,'50eme Anniversaire Lune',2004,0,'La Poste belge et les éditions Moulinsart pour le 50e anniversaire de l’album des Aventures de Tintin « On a marché sur la Lune » d’Hergé, produisent une série de cinq timbres et un feuillet commémorant cette fabuleuse aventure',''),(125,'Memories Silan',1973,0,'2 Jeux de cartes de mémoire sortent en 1973 pour la sortie au cinema du Lac aux Requins',''),(126,'Mako Collection',1996,0,'Série de 3 moulages sortis individuellement',''),(127,'Mako Moulage',0,0,'Série de 2 boites',''),(128,'ML 2011 Les Archives de Tintin',2011,0,'Figurines en relief en métal d\'environ 5.5cm',''),(129,'ML 2012 Les Archives de Tintin',2012,0,'Figurines en relief en métal d\'environ 5.5cm',''),(130,'ML 2013 Les Archives de Tintin',2013,0,'Figurines en relief en métal d\'environ 5.5cm',''),(131,'ML 2014 Les Archives de Tintin',2014,0,'Figurines en relief en métal d\'environ 5.5cm',''),(132,'Figurines Corner',1994,0,'Série produite pendant les années 1994/1995.\r\nElle comprend 51 figurines.\r\nLa licence n\'a pas été renouvelée.',''),(134,'Totem Dhor',0,0,'',''),(135,'Weta',2011,0,'Les statuettes fabriquées par Weta sont les reporductions des personnages du film de Spielberg.',''),(136,'Chèques Tintin',0,0,'Tout ce qui concerne les objets que l\'on pouvait avoir avec les chèques Tintin',''),(137,'Mini Albums Olibet',0,0,'',''),(138,'Meccano 2011',2011,0,'',''),(139,'ML 2012 Oscar',2012,0,'',''),(140,'70 ans Tintin au Congo',2001,0,'',''),(141,'Lipton',2003,0,'Réedition de porte-clefs pour le marché asiatique.Idem à la série CITEL','BOITE   PUBLICITAIRE POUR  LIPTON         \r\nHORS COMMERCE POUR LE MARCHE ASIATIQUE \r\n\r\nFORMAT  DE LA BOITE 18,5 x 15,5    cm'),(142,'Andros',1983,0,'Contre l\'envoi de 12 points découpés sur les pots de confitures ou compotes Andros et 3 timbres de 1.40 Francs. Andros Envoyaient 3 puzzles de cette série.',''),(143,'Puzzles Dubreucq',1943,0,'Des licences ont été accordées à Dubreucq pour réaliser des puzzles. La valeur de ces puzzles varient selon l\'état et la rareté : 150 à 1500€.\r\nCertains existent en 2 versions 60 et 155 pièces.','Les dates parutions semblent etre entre 1943 et 44\r\nUn en 1950'),(144,'TY',2011,7,'Sortie à l\'occasion du film de S.Spielberg',''),(145,'ACI Porcelaines',1994,0,'','');
